
//отображаем матрицу 4х4
document.getElementById('4x4').onclick = function() {
  let URL4 = 'https://raw.githubusercontent.com/rolling-scopes-school/tasks/master/tasks/stage-2/codejam-canvas/data/4x4.json';
  let data;
  let xhr = new XMLHttpRequest();
  let xhrLoadHandler = function() {
     data = JSON.parse(xhr.responseText);
     };
  xhr.addEventListener('load', xhrLoadHandler);
  xhr.open('GET', URL4, false);
  xhr.send();


  let canvas = document.getElementById('canvas');
  let ctx = canvas.getContext('2d');
  ctx.clearRect(0, 0, canvas.width, canvas.height);

  let y = 0;

  for (let i=0; i < data.length; i++) {
    let x = 0;
    let size = data.length;
    let pixelScale = 512/size;
    for (let j=0; j < data[0].length; j++) {
      let color = '#' + data[i][j];
      ctx.fillStyle = color;
      ctx.fillRect (x, y, pixelScale, pixelScale);
      x += pixelScale;
    }
    y += pixelScale;
  }
}

